import Styles from './UI/styles.module.css';
import { IButton } from "../../app/models/models";

export function Button(props:IButton) {
	return(
		<button className={props.type === 0 ? `${Styles.button}` : props.type === 1 ? `${Styles.greenButton} ${Styles.button}` : props.type === 2 ? `${Styles.redButton} ${Styles.button}` : `${Styles.button}`}>
			{props.children ? props.children : ''}
		</button>
	);
}
